    let loop = document.querySelector(".loupe");
    let extended=false;
    let inputFr = document.querySelector(".input-frame");
    let cross=document.querySelector(".cross");
    let searchBox = document.querySelector(".search-box")

    cross.addEventListener("click",function(e)
    {
        document.querySelector("#search-area").value="";
    });

    loop.addEventListener("click",function(e)
    {
        if (extended)
        {
            inputFr.style.display = "none";
            extended=false;
            searchBox.style="border-radius: 100%";
        }
        else
        {
            inputFr.style.display = "flex";
            extended=true;
            searchBox.style="border-radius: 15px";
        }

        searchBox.addEventListener("mouseleave",function(e)
        {
            inputFr.style.display = "none";
            extended=false;
            searchBox.style="border-radius: 100%";
        });
    });



function buttonClicked(x)
{
    x.classList.toggle("change");

    if (document.querySelector(".header-left>nav>ul").style.getPropertyValue("visibility") == "visible")
    {
        document.querySelector(".header-left>nav>ul").style.visibility = "hidden";
    } else
    {
        document.querySelector(".header-left>nav>ul").style.visibility = "visible";
    }
}
